6:22:12','陈太智',116,'纽约贫民区住着一个意大利人，名叫莱昂（让·雷诺饰），他是一名职业杀手。一天，邻居家小姑娘玛蒂尔达（娜塔莉·波特曼饰）敲开了他的房门，要求在他这里暂避杀身之祸。原来，邻居家的主人是警察的眼线，因贪污了一小包毒品而遭到恶警史丹菲尔（加里·奥德曼饰）剿灭全家的惩罚。玛蒂尔达得到莱昂的救助，开始帮莱昂管理家务并教其识字，莱昂则教女孩用枪，两人相处融洽。并且在他们之间还产生了一种奇妙的化学反应：爱情。女孩跟踪史丹菲尔，贸然去报仇，不小心被抓。莱昂及时赶到，将女孩救回。他们再次搬家，但女孩还是落入史丹菲尔之手。莱昂撂倒一片警察，再次救出女孩并让她通过通风管道逃生，并嘱咐她去把他积攒的钱取出来。莱昂则化装成警察试图混出包围圈，但被狡猾的史丹菲尔识破，不得已引爆了身上的炸弹。',1,0),(131,117,'','2019-06-05 16:22:40','陈太智',116,'约贫民区住着一个意大利人',1,0),(132,117,'','2019-06-05 16:25:50','陈太智',116,'纽约贫民区住着一个意大利人，名叫莱昂（让·雷诺饰），他是一名职业杀手。一天，邻居家小姑娘玛蒂尔达（娜塔莉·波特曼饰）敲开了他的房门，要求在他这里暂避杀身之祸。原来，邻居家的主人是警察的眼线，因贪污了一小包毒品而遭到恶警史丹菲尔（加里·奥德曼饰）剿灭全家的惩罚。玛蒂尔达得到莱昂的救助，开始帮莱昂管理家务并教其识字，莱昂则教女孩用枪，两人相处融洽。并且在他们之间还产生了一种奇妙的化学反应：爱情。女孩跟踪史丹菲尔，贸然去报仇，不小心被抓。莱昂及时赶到，将女孩救回。他们再次搬家，但女孩还是落入史丹菲尔之手。莱昂撂倒一片警察，再次救出女孩并让她通过通风管道逃生，并嘱咐她去把他积攒的钱取出来。莱昂则化装成警察试图混出包围圈，但被狡猾的史丹菲尔识破，不得已引爆了身上的炸弹。纽约贫民区住着一个意大利人，名叫莱昂（让·雷诺饰），他是一名职业杀手。一天，邻居家小姑娘玛蒂尔达（娜塔莉·波特曼饰）敲开了他的房门，要求在他这里暂避杀身之祸。原来，邻居家的主人是警察的眼线，因贪污了一小包毒品而遭到恶警史丹菲尔（加里·奥德曼饰）剿灭全家的惩罚。玛蒂尔达得到莱昂的救助，开始帮莱昂管理家务并教其识字，莱昂则教女孩用枪，两人相处融洽。并且在他们之间还产生了一种奇妙的化学反应：爱情。女孩跟踪史丹菲尔，贸然去报仇，不小心被抓。莱昂及时赶到，将女孩救回。他们再次搬家，但女孩还是落入史丹菲尔之手。莱昂撂倒一片警察，再次救出女孩并让她通过通风管道逃生，并嘱咐她去把他积攒的钱取出来。莱昂则化装成警察试图混出包围圈，但被狡猾的史丹菲尔识破，不得已引爆了身上的炸弹。纽约贫民区住着一个意大利人，名叫莱昂（让·雷诺饰），他是一名职业杀手。一天，邻居家小姑娘玛蒂尔达（娜塔莉·波特曼饰）敲开了他的房门，要求在他这里暂避杀身之祸。原来，邻居家的主人是警察的眼线，因贪污了一小包毒品而遭到恶警史丹菲尔（加里·奥德曼饰）剿灭全家的惩罚。玛蒂尔达得到莱昂的救助，开始帮莱昂管理家务并教其识字，莱昂则教女孩用枪，两人相处融洽。并且在他们之间还产生了一种奇妙的化学反应：爱情。女孩跟踪史丹菲尔，贸然去报仇，不小心被抓。莱昂及时赶到，将女孩救回。他们再次搬家，但女孩还是落入史丹菲尔之手。莱昂撂倒一片警察，再次救出女孩并让她通过通风管道逃生，并嘱咐她去把他积攒的钱取出来。莱昂则化装成警察试图混出包围圈，但被狡猾的史丹菲尔识破，不得已引爆了身上的炸弹。纽约贫民区住着一个意大利人，名叫莱昂（让·雷诺饰），他是一名职业杀手。一天，邻居家小姑娘玛蒂尔达（娜塔莉·波特曼饰）敲开了他的房门，要求在他这里暂避杀身之祸。原来，邻居家的主人是警察的眼线，因贪污了一小包毒品而遭到恶警史丹菲尔（加里·奥德曼饰）剿灭全家的惩罚。玛蒂尔达得到莱昂的救助，开始帮莱昂管理家务并教其识字，莱昂则教女孩用枪，两人相处融洽。并且在他们之间还产生了一种奇妙的化学反应：爱情。女孩跟踪史丹菲尔，贸然去报仇，不小心被抓。莱昂及时赶到，将女孩救回。他们再次搬家，但女孩还是落入史丹菲尔之手。莱昂撂倒一片警察，再次救出女孩并让她通过通风管道逃生，并嘱咐她去把他积攒的钱取出来。莱昂则化装成警察试图混出包围圈，但被狡猾的史丹菲尔识破，不得已引爆了身上的炸弹。',1,0),(135,5492,'','2019-06-06 09:13:17','陈太智',116,'房斯蒂芬',1,0),(136,5492,'/static/customer/genjin/5492/49b06d600c338744b0703a195a0fd9f9d62aa0b6.jpg_5492.jpg|','2019-07-01 15:56:16','陈太智',116,'2